import React from 'react'
import PropTypes from 'prop-types'
import Button from 'shared/button'

const Banner = props => {
  const { text, buttonText, controlBanner, bannerAction } = props
  return (
    <div className='banner'>
      <i className={`mdi mdi-information-outline`} />
      <div className='banner__text'>{text}</div>
      <Button
        buttonStyle='primary-alert'
        type='submit'
        className='banner__button'
        onClick={bannerAction}
      >
        {buttonText}
      </Button>
      <i className={`mdi mdi-close banner__icon`} onClick={controlBanner} />
    </div>
  )
}

export default Banner

Banner.propTypes = {
  text: PropTypes.string,
  buttonText: PropTypes.string,
  color: PropTypes.string,
  controlBanner: PropTypes.func,
  bannerAction: PropTypes.func
}

Banner.defaultProps = {
  text: '',
  buttonText: '',
  color: '',
  controlBanner: () => {},
  bannerAction: () => {}
}
